import React from 'react';
import { getRandomMember } from './FooterCardConstants.js';

export const MemberCard = () => {
  let currentMember = getRandomMember();

  return (
    <div className="cardPreviewBorder noselect">
      <div className="cardPreview">
        <div className="cardPreviewText">
          <div className="cardPreviewMainText">
            {currentMember.name}({currentMember.age})
          </div>
          <div className="cardPreviewSubText">
            {currentMember.job}&nbsp;<span className="japaneseName">{currentMember.japaneseName}</span>
          </div>
        </div>
        <div className="cardPreviewShadow"></div>
        <img
          draggable={false}
          className="cardPreviewImage nopointerevent"
          alt="Background for Card"
          src={currentMember.image.url}
        />
      </div>
    </div>
  )
}

export const EventCard = () => {
  return (
    "event"
  )
}

export const GoalCard = () => {
  return (
    "goal"
  )
}
